import ExpenseItem from "./ExpenseItem"
import './ExpenseItem'

export default function ExpenseItems(props) {

return (
    <>
            {props.items.map(item => 
                <ExpenseItem title={item.title} amount={item.amount} date={item.date} />
            
        )}
    </>
    )
}
